package sk.richard.uloha10;


public class Obdlznik {
	
	private int vyska;
	private int sirka;
	
	public Obdlznik(int vyska, int sirka) {
	
		this.vyska = vyska;
		this.sirka = sirka;
	}
	
	public double getSirka() {
		return sirka;
	}
	

	public double getVyska() {
		// TODO Auto-generated method stub
		return vyska;
	}

	
	

}
